import React from "react";
import BackImage from "./back_imagePot.jpg"

const BackImg=()=>{
    return(
    <div style={{
        position:"relative",
        left:"1%",
        zIndex:0
    }}>
        <img className="backImg" src={BackImage}/>
    </div>
)
}

export default BackImg;
